const crypto = require("crypto");
const alg = "aes-256-ctr";
const pwd = "abcdabcd";

const text = "token_13464735132132131354165465";
const cipher = cipher.createCipher(alg, pwd);
const crypted = cipher.update(text, "utf8", "hex");

function teste() {
    console.log(crypted);
}
